window.bookSummaryJSON = "<p>Number one <i>New York Times</i> and <i>USA Today</i> best-selling author Charlaine Harris is at her best in this alternate history of the United States where magic is an acknowledged but despised power in this third installment of the Gunnie Rose series. </p> <p>Picking up right where <i>A Longer Fall</i> left off, this thrilling third installment follows Lizbeth Rose as she takes on one of her most dangerous missions yet: rescuing her estranged partner, Prince Eli, from the Holy Russian Empire. Once in San Diego, Lizbeth is going to have to rely upon her sister Felicia, and her growing Grigori powers to navigate her way through this strange new world of royalty and deception in order to get Eli freed from jail where he’s being held for murder. </p> <p>Russian Cage continues to ramp up the momentum with more of everything Harris’ listeners adore her for with romance, intrigue, and a deep dive into the mysterious Holy Russian Empire. </p> <p>Performed by Colleen Delany, Dani Stoller, Robbie Gay, Stephon Walker, Alejandro Ruiz, Laura C. Harris, Alysia Beltran, Bradley Foster Smith, Chris Davenport, Holly Adams, Jessica Lauren Ball, Joey Sourlis, Julie Hoverson, Kay Eluvian, Ken Jackson, Kimberly Gilbert, Lucy Symons, Matthew Bassett, Michael John Casey, Mike Chiporkin, Nanette Savard, Niusha Nawab, Nora Achrati, Scott McCormick, and Shanta Parasuraman.</p>"; 
